describe('Network Matchers', () => {

    //Checks that network resource was called
    it('toBeRequested', async () => {
        const mock = await browser.mock('https://pokeapi.co/api/v2/pokemon/ditto');
        await browser.url('https://pokeapi.co/api/v2/pokemon/ditto');
        await expect(mock).toBeRequested();
    });

    //Checks that network resource was called for the expected amount of times
    it('toBeRequestedTimes', async () => {
        const mock = await browser.mock('https://pokeapi.co/api/v2/pokemon/ditto');
        await browser.url('https://pokeapi.co/api/v2/pokemon/ditto');
        await browser.url('https://pokeapi.co/api/v2/pokemon/ditto');
        await browser.url('https://pokeapi.co/api/v2/pokemon/ditto');
 
        await expect(mock).toBeRequestedTimes({ gte: 3, lte: 5 }) // request called at least 3 times but less than 5
    });

    //Checks that mock was called according to the expected options.
    it('toBeRequestedWith', async () => {
        const mock = await browser.mock('https://pokeapi.co/api/v2/pokemon/ditto', { method: 'GET' });
